INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Attack On Titan', 'https://webcomicbucket.s3.amazonaws.com/manga/Attack-On-Titan/thumbnail.jpg', 'Centuries ago, mankind was slaughtered to near extinction by monstrous humanoid creatures called Titans, forcing humans to hide in fear behind enormous concentric walls. What makes these giants truly terrifying is that their taste for human flesh is not born out of hunger but what appears to be out of pleasure. To ensure their survival, the remnants of humanity began living within defensive barriers, resulting in one hundred years without a single titan encounter. However, that fragile calm is soon shattered when a colossal Titan manages to breach the supposedly impregnable outer wall, reigniting the fight for survival against the man-eating abominations. After witnessing a horrific personal loss at the hands of the invading creatures, Eren Yeager dedicates his life to their eradication by enlisting into the Survey Corps, an elite military unit that combats the merciless humanoids outside the protection of the walls. Eren, his adopted sister Mikasa Ackerman, and his childhood friend Armin Arlert join the brutal war against the Titans and race to discover a way of defeating them before the last walls are breached.', '1', 'horror', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Beck', 'https://webcomicbucket.s3.amazonaws.com/manga/Beck/thumbnail.jpg', 'Yukio Koyuki Tanaka wasted away his middle school days listening to Japanese pop music and apathetically trudging through life�until a casual run-in with the enigmatic guitarist Ryuusuke Ray Minami. Through this encounter, Koyuki realizes what he has been missing all this time as Ray introduces him to western rock music and jumpstarts his desire to play guitar. Although various struggles plague his path to rock fame, Koyuki refuses to abandon the passion that gave his life purpose, balancing it together with school, work, and friends. Beck tells the story of the love and trial that accompanies pursuing a professional career in music as Koyuki and Ray work toward realizing the guitarists dream of the ultimate band.', '1', 'slice of life', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Black Lagoon', 'https://webcomicbucket.s3.amazonaws.com/manga/Black-Lagoon/thumbnail.jpg', 'Lock n load with the baddest group of mercenaries ever to hit the high seas of Southeast Asia. Aboard their World War II torpedo boat, the Black Lagoon, Dutch the Boss, Benny the Mechanic, Revy Two Hand, and Rock, the salaryman from Japan, deliver anything, anywhere. In the dangerous underworld of the Russian Mafia, Chinese triads, Colombian drug cartels, crazed assassins, and ruthless mercenaries, its hard to know who to trust. But if youve got a delivery to make, and you dont mind a little property damage along the way, you can count on the crew of the Black Lagoon. Rokuro Okajima is just an average Japanese salaryman, living an average life. But when hes taken hostage by the crew of the Black Lagoon, Rokuro finds himself thrown headfirst into a deadly world of outlawed heroes, brutal villains, and blazing gunfights. Where he ends up is anyones guess, but one thing is for certain hes in for a wild ride.', '1', 'action', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Bleach', 'https://webcomicbucket.s3.amazonaws.com/manga/Bleach/thumbnail.jpg', 'Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.Ichigo Kurosaki never asked for the ability to see ghosts�he was born with the gift. When his family is attacked by a Hollow�a malevolent lost soul�Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo�s Bleach has become an international manga smash-hit.Ichigo Kurosaki has always been able to see ghosts, but this ability doesnt change his life nearly as much as his close encounter with Rukia Kuchiki, a Soul Reaper and member of the mysterious Soul Society. While fighting a Hollow, an evil spirit that preys on humans who display psychic energy, Rukia attempts to lend Ichigo some of her powers so that he can save his family; but much to her surprise, Ichigo absorbs every last drop of her energy. Now a full-fledged Soul Reaper himself, Ichigo quickly learns that the world he inhabits is one full of dangerous spirits and, along with Rukia--who is slowly regaining her powers--its Ichigos job to protect the innocent from Hollows and help the spirits themselves find peace.', '1', 'shonen', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Berserk', 'https://webcomicbucket.s3.amazonaws.com/manga/Berserk/thumbnail.jpg', 'His name is Guts, the Black Swordsman, a feared warrior spoken of only in whispers. Bearer of a gigantic sword, an iron hand, and the scars of countless battles and tortures, his flesh is also indelibly marked with The Brand, an unholy symbol that draws the forces of darkness to him and dooms him as their sacrifice. But Guts wont take his fate lying down; hell cut a crimson swath of carnage through the ranks of the damned�and anyone else foolish enough to oppose him. Accompanied by Puck the Elf, more an annoyance than a companion, Guts relentlessly follows a dark, bloodstained path that leads only to death...or vengeance.', '1', 'horror', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Claymore', 'https://webcomicbucket.s3.amazonaws.com/manga/Claymore/thumbnail.jpg', 'When a shapeshifting demon with a thirst for human flesh, known as youma, arrives in Rakis village, a lone woman with silver eyes walks into town with only a sword upon her back. She is a Claymore, a being manufactured as half-human and half-youma, for the express purpose of exterminating these monsters. After Rakis family is killed, the Claymore saves his life, but he is subsequently banished from his home. With nowhere else to go, Raki finds the Claymore, known as Clare, and decides to follow her on her journeys. As the pair travel from town to town, defeating youma along the way, more about Clares organization and her fellow warriors comes to light. With every town cleansed and every demon destroyed, they come closer to the youma on which Clare has sought vengeance ever since she chose to become a Claymore.', '1', 'action', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('D Gray Man', 'https://webcomicbucket.s3.amazonaws.com/manga/D-Gray-Man/thumbnail.jpg', 'A cursed teenage boy saves mankind one soul at a time. Set in a fictional 19th century England, D.Gray-man is the story of Allen Walker, a 15-year-old boy who roams the earth in search of Innocence. Washed away to unknown parts of the world after The Great Flood, Innocence is the mysterious substance used to create weapons that obliterate demons known as akuma. A born exorcist, Walkers primary anti-akuma weapon is the cross thats embossed on his red, disfigured left hand, which contains Innocence. But not only does Walker destroy akuma, he sees the akuma hiding inside a persons soul. Together with his fellow exorcists fighting under the command of the Black Order, Walker leads the battle against the Millennium Earl, the evil being out to destroy mankind.', '1', 'shonen', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Deadman Wonderland', 'https://webcomicbucket.s3.amazonaws.com/manga/Deadman-Wonderland/thumbnail.jpg', 'Ten years have passed since the Great Tokyo Earthquake, and the peoples memories of the disaster have faded. Ganta Igarashi, a middle school evacuee, has finally begun to live a normal life...that is, until the day Red Man appears at his school and Gantas fate is changed forever. His entire class is brutally murdered, and although innocent of the crime, Ganta is sentenced to death and sent to the bizarre prison known as Deadman Wonderland.', '1', 'horror', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Death Note', 'https://webcomicbucket.s3.amazonaws.com/manga/Death-Note/thumbnail.jpg', 'Light Yagami is an ace student with great prospects - and hes bored out of his mind. But all that changes when he finds the Death Note, a notebook dropped by a rogue Shinigami, a death god. Any human whose name is written in the notebook dies, and now Light has vowed to use the power of the Death Note to rid the world of evil. But when criminals begin dropping dead, the authorities send the legendary detective L to track down the killer. With L hot on his heels, will Light lose sight of his noble goal... or his life?', '1', 'horror', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Fruit Basket', 'https://webcomicbucket.s3.amazonaws.com/manga/Fruit-Basket/thumbnail.jpg', 'Tooru Honda has always been fascinated by the story of the Chinese zodiac that her beloved mother told her as a child. However, a sudden family tragedy changes her life, and subsequent circumstances leave her all alone. Tooru is now forced to live in a tent, but little does she know that her temporary home resides on the private property of the esteemed Souma family. Stumbling upon their home one day, she encounters Shigure, an older Souma cousin, and Yuki, the prince of her school. Tooru explains that she lives nearby, but the Soumas eventually discover her well-kept secret of being homeless when they see her walking back to her tent one night. Things start to look up for Tooru as they kindly offer to take her in after hearing about her situation. But soon after, she is caught up in a fight between Yuki and his hot-tempered cousin, Kyou. While trying to stop them, she learns that the Souma family has a well-kept secret of their own: whenever they are hugged by a member of the opposite sex, they transform into the animals of the Chinese zodiac. With this new revelation, Tooru will find that living with the Soumas is an unexpected adventure filled with laughter and romance.', '1', 'slice of life', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Fullmetal Alchemist', 'https://webcomicbucket.s3.amazonaws.com/manga/Fullmetal-Alchemist/thumbnail.jpg', 'After a horrific alchemy experiment goes wrong in the Elric household, brothers Edward and Alphonse are left in a catastrophic new reality. Ignoring the alchemical principle banning human transmutation, the boys attempted to bring their recently deceased mother back to life. Instead, they suffered brutal personal loss: Alphonses body disintegrated while Edward lost a leg and then sacrificed an arm to keep Alphonses soul in the physical realm by binding it to a hulking suit of armor. The brothers are rescued by their neighbor Pinako Rockbell and her granddaughter Winry. Known as a bio-mechanical engineering prodigy, Winry creates prosthetic limbs for Edward by utilizing automail, a tough, versatile metal used in robots and combat armor. After years of training, the Elric brothers set off on a quest to restore their bodies by locating the Philosophers Stone a powerful gem that allows an alchemist to defy the traditional laws of Equivalent Exchange. As Edward becomes an infamous alchemist and gains the nickname Fullmetal, the boys journey embroils them in a growing conspiracy that threatens the fate of the world.', '1', 'fantasy', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Hellsing', 'https://webcomicbucket.s3.amazonaws.com/manga/Hellsing/thumbnail.jpg', 'Hellsing, an organization specializing in dealing with supernatural threats, is called in to eliminate a vampire that is turning the villagers of Cheddar into ghouls. To put an end to this, the leader of the organization, Sir Integra Fairbrook Wingates Hellsing, dispatches her most formidable asset: a powerful vampire known as Alucard. Armed with only a single handgun, Alucard wreaks havoc on the monsters plaguing Cheddar. However, a young police officer, Seras Victoria, gets caught up in the chaos and becomes mortally wounded as a result. Taking pity on the girl, Alucard gives her a choice: die as a human or live on as a vampire. Seras accepts his offer and begins a new life as a member of Hellsing. Though it was her decision, Seras struggles with the fact that she is no longer human. Nevertheless, she must embrace being a creature of the night soon if she wants to survive on the front lines in the fight between humans and the supernatural.', '1', 'action', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Monster', 'https://webcomicbucket.s3.amazonaws.com/manga/Monster/thumbnail.jpg', 'An ice-cold killer is on the loose, and brilliant Dr. Kenzo Tenma is the only one who can stop him. Conspiracies, serial murders, and a scathing indictment of hospital politics are all masterfully woven together in this compelling manga thriller. Tenma risks his promising medical career to save the life of a critically wounded young boy. Unbeknownst to him, this child is destined for a terrible fate. Who could have known that Tenma would create a monster.', '1', 'horror', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Naruto', 'https://webcomicbucket.s3.amazonaws.com/manga/Naruto/thumbnail.jpg', 'Twelve years ago the Village Hidden in the Leaves was attacked by a fearsome threat. A nine-tailed fox spirit claimed the life of the village leader, the Hokage, and many others. Today, the village is at peace, and a troublemaking kid named Naruto is struggling to graduate from Ninja Academy. His goal may be to become Hokage, but his true destiny will be much more complicated. The adventure begins now.', '1', 'shonen', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Rurouni Kenshin', 'https://webcomicbucket.s3.amazonaws.com/manga/Rurouni-Kenshin/thumbnail.jpg', 'Packed with action, romance and historical intrigue, Rurouni Kenshin is one of the most beloved and popular manga series worldwide. Set against the backdrop of the Meiji Restoration, it tells the saga of Himura Kenshin, once an assassin of ferocious power, now a humble rurouni, a wandering swordsman fighting to protect the honor of those in need. A hundred and fifty years ago in Kyoto, amid the flames of revolution, there arose a warrior, an assassin of such ferocious power he was given the title Hitokiri: Manslayer. With his bloodstained blade, Hitokiri Battosai helped close the turbulent Bakumatsu period and end the reign of the shoguns, slashing open the way toward the progressive Meiji Era.  Then he vanished, and with the flow of years became legend.', '1', 'historical fiction', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Soul Eater', 'https://webcomicbucket.s3.amazonaws.com/manga/Soul-Eater/thumbnail.jpg', 'Maka is a weapon meister, determined to turn her partner, a living scythe named Soul Eater, into a powerful death scythe - the ultimate weapon of Death himself. Charged with the task of collecting and devouring the tainted souls of ninety-nine humans and one witch, Maka and her fellow meisters strive to master their weapons as they face off against the bizarre and dangerous minions of the underworld. But the meisters own personal quirks may prove a bigger obstacle than any sultry enchantress.', '1', 'shonen', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Tokyo Ghoul', 'https://webcomicbucket.s3.amazonaws.com/manga/Tokyo-Ghoul/thumbnail.jpg', 'Lurking within the shadows of Tokyo are frightening beings known as ghouls, who satisfy their hunger by feeding on humans once night falls. An organization known as the Commission of Counter Ghoul (CCG) has been established in response to the constant attacks on citizens and as a means of purging these creatures. However, the problem lies in identifying ghouls as they disguise themselves as humans, living amongst the masses so that hunting prey will be easier. Ken Kaneki, an unsuspecting university freshman, finds himself caught in a world between humans and ghouls when his date turns out to be a ghoul after his flesh. Barely surviving this encounter after being taken to a hospital, he discovers that he has turned into a half-ghoul as a result of the surgery he received. Unable to satisfy his intense craving for human meat through conventional means, Kaneki is taken in by friendly ghouls who run a coffee shop in order to help him with his transition. As he begins what he thinks will be a peaceful new life, little does he know that he is about to find himself at the center of a war between his new comrades and the forces of the CCG, and that his new existence has caught the attention of ghouls all over Tokyo.', '1', 'action', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Vagabond', 'https://webcomicbucket.s3.amazonaws.com/manga/Vagabond/thumbnail.jpg', 'Real life figure Miyamoto Musashi was the most celebrated samurai of all time. The quintessential warrior philosopher, Musashi authored A Book of Five Rings, a theoretical guide to military strategy still used today. But the path to enlightenment in feudal era Japan was fraught with peril. At seventeen years of age, Musashi still known by his childhood name, Shinmen Takezo was a wild young brute just setting out along the way of the sword. In the aftermath of the epic Battle of Sekigahara, Takezo finds himself a fugitive survivor on the losing side of the war. Takezos vicious nature has made him an outcast even in his own village, and he is hunted down like an animal. At this crucial crossroads in Takezos life, an eccentric monk and a childhood friend are the only ones who can help him find his way.', '1', 'historical fiction', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Xxxholic', 'https://webcomicbucket.s3.amazonaws.com/manga/Xxxholic/thumbnail.jpg', 'Watanuki Kimihiro is haunted by visions of ghosts and spirits. Seemingly by chance, he encounters a mysterious witch named Yuuko, who claims she can help. In desperation, he accepts, but realizes that hes just been tricked into working for Yuuko in order to pay off the cost of her services. Soon hes employed in her little shop, a job which turns out to be nothing like his previous work experience.', '1', 'fantasy', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Trinity Blood', 'https://webcomicbucket.s3.amazonaws.com/manga/Trinity-Blood/thumbnail.jpg', 'Following Armageddon, an apocalyptic war, mankind faces yet another menace: vampires. The continuous confrontations between the races have split the world into separate factions. The race of vampires, Methuselah, are affiliated with the New Human Empire; whereas the humans, deemed Terrans by the vampires, make up the Vatican Papal State. Furthermore, extremist groups like the Rosenkreuz Order strive to rekindle a war, despite the factions attempts to avoid direct conflict. To combat terrorist organizations, the Vatican has implemented the AX unit. Led by Cardinal Caterina Sforza, the AX agents investigate vampire-related disturbances with hopes that the Terrans and the Methuselah will one day achieve peaceful coexistence. Amongst the AX unit is priest Abel Nightroad�a seemingly disoriented but gentle-hearted fellow who is a fierce vampire slayer on the battlefield. Joining the unit as his partner is agent Sister Esther Blanchett, a brave and gentle young nun troubled with a tragic past. As the two grow closer, they begin to uncover signs of malicious schemes and dark forces working in the shadows. But the path they walk is riddled with misfortune that might just force them to confront the memories that plague their hearts.', '1', 'action', '0');
INSERT INTO manga (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Yu Yu Hakusho', 'https://webcomicbucket.s3.amazonaws.com/manga/Yu-Yu-Hakusho/thumbnail.jpg', 'Yusuke Urameshi was a tough teen delinquent until one selfless act changed his life... by ending it. When he died saving a little kid from a speeding car, the afterlife didnt know what to do with him, so it gave him a second chance at life. Now, Yusuke is a ghost with a mission, performing good deeds at the behest of Botan, the spirit guide of the dead, and Koenma, her pacifier-sucking boss from the other side. But what strange things await him on the borderline between life and death?', '1', 'shonen', '0');
INSERT INTO webtoon (ip_title, thumbnail_address, ip_description, number_of_chapters, genre, views) VALUES ('Solo Max Level Newbie', 'https://webcomicbucket.s3.amazonaws.com/webtoon/Solo-Max-Level-Newbie/thumbnail.jpg', 'Jinhyuk, a gaming Nutuber, was the only person who saw the ending of the game "Tower of Trials". However, when the games popularity declined, it became difficult for him to continue making a living as a gaming Nutuber. Since he already saw the ending of the game, he was about to quit playing. But that day, "Tower of Trials" became reality, and Jinhyuk, who knew about every single thing in the game, took over everything faster than anyone possibly could!', '1', 'action', '0');
